import React from "react";
import { Container, Form } from "react-bootstrap";
import styles from "./style.module.css";

const AppointmentPage = () => {
  return (
    <Container className={styles.container}>
      <h1>Reservar Cita</h1>
      <Form></Form>
    </Container>
  );
};

export default AppointmentPage;
